import react from 'react'
import Header from './header'
import DoctorsSpecialtyData from './data/DoctorsSpecialtyData'
import DoctorsSpecialtyAside from './DoctorsSpecialtyAside'

export default function SearchDoctors() {
  // console.log(DoctorsSpecialtyData)

  return (
    <>
      <Header></Header>
      <section className="flex w-full text-white">
        <div className='flex w-full'>
        {/* aside to show specialties of doctors */}
        <DoctorsSpecialtyAside data={DoctorsSpecialtyData}></DoctorsSpecialtyAside>


        </div>
      </section>
    </>
  )
}
